import Chat from './components/Chat';
// import './App.css';
import Room from './components/Room';

function App(){
  const [roomId, setRoomId] = useState(null)

  return (
    <div>
      <Room setRoomId={setRoomId}/>
        <Chat roomId={roomId}/>
    </div>
  )

}

export default App
